import { Component } from "react";
import DashboardHead from '../../component/layouts/Dashboard/DashboardHead';
import DashboardBody from '../../component/layouts/Dashboard/DashboardBody';
import Main from '../../component/layouts/Dashboard/Main';
import HomeView from '../../component/views/dashboard/homeView';
import HistoryView from '../../component/views/dashboard/historyView';

import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

class Dashboard extends Component {

    render(){
        return(
            <Router>
                <div>
                    <DashboardHead title="Dashboard"/>
                    <DashboardBody>
                        <Main>

                            <Switch>
                                <Route path="/">
                                    <HomeView />
                                </Route>

                                <Route path="/history">
                                    <HistoryView />
                                </Route>
                            </Switch>

                        </Main>
                    </DashboardBody>
                </div>                
            </Router>
        )
    }

}

export default Dashboard;
